	add("decompensation", "{\"term\":\"decompensation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The inability of a diseased or weakened organic system or organ to compensate for its deficiency, resulting in functional deterioration\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, Pamela Martyn, \u0026quot;If You Guessed Cardiovascular Disease, Guess again,\u0026quot; \u0027American Journal of Nursing\u0027, vol. 82, no. 8, p. 1239\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Once it was determined that hyperthyroidism was the probable etiology of her cardiac \u0027\u0027decompensation\u0027\u0027, the next step was treatment of the underlying disease\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The deterioration of cognitive or emotional functionality in a person who is distressed or who suffers from a psychological disorder\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1945\u0027\u0027, William C. Menninger, \u0026quot;The Mentally or Emotionally Handicapped Veteran,\u0026quot; \u0027Annals of the American Academy of Political and Social Science\u0027, vol. 239 (May), p. 21\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A varying percentage of our combat soldiers reach the limit of their endurance and must leave their foxholes, not for physical wounds but because of emotional \u0027\u0027decompensation\", \"priority\":6}]}, \"synonyms\":{}}");

